package db.domain;import java.util.Arrays;import java.util.Date;public class ActivityStatusImpl implements ActivityStatus {	@Key	private String activityName;	private String status;	private Date startTime;	public ActivityStatusImpl() {	}	public ActivityStatusImpl(ActivityStatus c) {		this.activityName = c.getActivityName();		this.status = c.getStatus();		this.startTime = c.getStartTime();	}	@Override	public String tableName() {		return "activity_status";	}	public void setActivityName(String activityName) {		this.activityName = activityName;	}	public String getActivityName() {		return this.activityName;	}public void addActivityName(String activityName) {		this.activityName += activityName;}	public void setStatus(String status) {		this.status = status;	}	public String getStatus() {		return this.status;	}public void addStatus(String status) {		this.status += status;}	public void setStartTime(Date startTime) {		this.startTime = startTime;	}	public Date getStartTime() {		return this.startTime;	}}